import React from 'react';
import { Slide } from 'react-slideshow-image';

import './Realizations.css';


const slideImages = [
  { url: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fsimplyoffgrid.com%2Fdiy-solar-panel-installation&psig=AOvVaw2PPSSfFWjsgjaRHMMtfVy3&ust=1614614986313000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCJD7vNn7jO8CFQAAAAAdAAAAABAX" }

];

const Realizations = () => {
  return (
    <div className="realizations__section">
      <div className="container">
        <h2 className="realizations__section_title">
          REALIZACJE
        </h2>
        <Slide>
          <div className="each-slide">
            <div style={{ 'backgroundImage': `url(${slideImages[0]})` }}>
              <span>Slide 1</span>
            </div>
          </div>
          <div className="each-slide">
            <div style={{ 'backgroundImage': `url(${slideImages[1]})` }}>
              <span>Slide 2</span>
            </div>
          </div>
          <div className="each-slide">
            <div style={{ 'backgroundImage': `url(${slideImages[2]})` }}>
              <span>Slide 3</span>
            </div>
          </div>
        </Slide>
      </div>
    </div>
  );
};
export default Realizations;
